  return (

    <form onSubmit={handleSubmit(onSubmit)}>
        <NewBoard>
    <label>Board Name</label>
      <input type='text' name="Description" ref={register({max: 25, min: 2, maxLength: 50})} />
    <label>Description</label>
      <textarea name="Board Name" ref={register({required: true, max: 100, min: 5})} />
